import {useParams} from "react-router-dom";
import Breadcrumbs from "../../components/breadcrumbs";

export default function MatchDetail(){
    let {id} = useParams();

    return (
        <div style={styles} className={"lg:px-20 py-5"}>
           <Breadcrumbs link={"Fotbal > Premier League"}/>
        </div>
    );

    const styles = {
        fontWeight: "bold"
    }
}
